import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-inscription-layout',
  templateUrl: './inscription-layout.component.html',
  styleUrls: ['./inscription-layout.component.css']
})
export class InscriptionLayoutComponent {
  helper = new JwtHelperService()
  encrypted_id: any
  data: any = { firstName: "", lastName: "", email: "", password: "" }
  firstName: any


  constructor(public Service: UsersService, private router: Router) {
    const token = localStorage.getItem('token');
    if (token && !this.helper.isTokenExpired(token)) {
      const decodedToken = this.helper.decodeToken(token);
      this.encrypted_id = decodedToken.userId;
    }
  }
}
